//https://leetcode.com/problems/find-median-from-data-stream
class MedianFinder {
public:
    priority_queue<int> left_max_heap;
    priority_queue<int, vector<int>, greater<int>> right_min_heap;
    MedianFinder() {
    }
    
    void addNum(int num) {
        if(left_max_heap.empty()){
            left_max_heap.push(num);
        }else if(left_max_heap.top() >= num){
            left_max_heap.push(num);
        }else{
            right_min_heap.push(num);
        }
        while(left_max_heap.size() > right_min_heap.size() + 1){
            int val = left_max_heap.top();
            left_max_heap.pop();
            right_min_heap.push(val);
        }
        while(right_min_heap.size() > left_max_heap.size() + 1){
            int val = right_min_heap.top();
            right_min_heap.pop();
            left_max_heap.push(val);
        }
    }
    
    double findMedian() {
        if(left_max_heap.size() > right_min_heap.size()){
            return (double)left_max_heap.top();
        }else if(left_max_heap.size() < right_min_heap.size()){
            return (double)right_min_heap.top();
        }else
            return double(left_max_heap.top() + right_min_heap.top())/2.0;
    }
};

